When a Nazi U-boat crew, headed by the ruthless Eric Portman, is stranded in
Canada in the thick of World War II, the men evade capture by hiding out in a
series of rural communities before trying to cross the border into the still-
neutral United States.

At once a compelling piece of anti-isolationist propaganda and a quick-witted
wartime thriller, 49TH PARALLEL is a classic early work from the inimitable
British filmmaking team of Michael Powell and Emeric Pressburger.

